import b64toBlob from 'b64-to-blob';

const frontImageB64 = '';

const sideImageB64 = '';

const contentType = 'image/png';

function getImages() {
  return {
    frontImage: b64toBlob(frontImageB64, contentType),
    sideImage: b64toBlob(sideImageB64, contentType),
  };
}

export default getImages;
